import React, { Component } from "react";

class Score extends Component {
  state = {
    score: 0,
    topScore: 0
  };
  render() {
    return (
      <div className="card">
        <div className="card-body">
          Score: {props.score} | Top Score: {props.topScore}
        </div>
      </div>
    );
  }
}

export default Score;
